import React, { Component, Fragment } from "react";
import { withAlert } from "react-alert";
import { connect } from "react-redux";

export class Todo extends Component {
  componentDidUpdate() {}

  render() {
    return <Fragment />;
  }
}

export default connect(null, null)(withAlert(Todo));
